import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
let rootElement  = document.getElementById('root');

const root = ReactDOM.render(<App /> , root);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
